April 21, 2010: Pity Fuck (Part Two) | Elise Graves, PD  + Pics 


PD has a soft spot for the screamers and the criers. Elise is one of his favorite play things because she happens to be both. Whenever he gets his hands on her her eyes begin to well up with tears. Once he starts to work her over the screams are beautiful. He is unbelievably cruel to her. She cannot escape, so she has no choice but to suffer and hope that if she is good enough he will make the pain stop. She loves giving away her control and he loves taking it from her.  





